INSERT INTO `article` VALUES (1,'0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28','Liby99',0,'2016-09-28 16:27:02','2016-09-29 02:07:20','This is a test','asdfasfd','asfasfd','asdfasdfasdf',0,5),(2,'e6997550-85dd-11e6-a53a-5c0f38edfc28','Liby99',2,'2016-09-28 17:44:38','2016-10-08 03:33:56','终于，我自己制作的博客系统完成了','纪念','NodeJs, Development, Blog System','<p>也算是花了不少时间。比之前的版本应该是稳定多了。</p><p>看起来自己的NodeJs技术真的还是有所提升的。看看这个系统以后能不能再完善一点，变成一个NodeJs的完整的框架或插件吧。</p><p>话说图片能存在数据库里这种事真是太有趣了</p><p>好随便卖点萌，这应该就算第一篇博客文章了？</p><p>嗯，就这样。</p><p>===更新===</p><p>看起来这篇文章总是让我的主界面崩坏掉。我一定要修好它。</p>',10,0),(3,'26fb11de-862a-11e6-a53a-5c0f38edfc28','Liby99',0,'2016-09-29 02:50:28','2016-09-29 02:50:28','This is for fielding','I need more articles','test','<p>This image is pretty good!</p>',0,0),(4,'22e7f3ee-86ef-11e6-a53a-5c0f38edfc28','Liby99',2,'2016-09-30 02:20:32','2016-09-30 02:20:32','对NodeJs感到奇怪了','好想做点web以外的东西','NodeJs, Development','<p>唉，自己是不是被NodeJs给束缚住了呢？</p><p>今天跟同学聊天，开始回顾起自己以前写的代码，也包括这个项目写的代码。然而莫名的发现......好像很简单的样子？？</p><p>其实自己写的东西可用性还是挺高的，性能也可以保证，毕竟因为没有使用太多框架。</p><p>或许可以把这个项目的源代码开源出去？</p><p>然而并没有什么特别的技术核心在这里面啊。。。</p><p>表示自己很迷茫</p><p>摆在自己面前的项目还是都是web的开发项目。</p><p>现在越来越想尝试一下新的东西了</p>',17,0),(5,'ad2858ea-86f0-11e6-a53a-5c0f38edfc28','Liby99',2,'2016-09-30 02:31:33','2016-09-30 02:31:33','海风&星空&代码','太平洋？','日常','<p>嗯我面前的楼底下就是太平洋（虽然你们可能看不出来</p><p>还算是挺好玩的宿舍</p><p>话说我分明知道的。。这些文章都没人看得见。。为什么我写的这么开心。。</p><p>晚安了</p>',26,0),(6,'b979a258-8ba9-11e6-80c4-e5922c263bb3','Liby99',2,'2016-10-06 02:46:15','2016-10-08 02:06:04','差不多把后台写好了','嗯','Development, liby.me, admin, blog','<p>啊啊啊啊啊这个感觉真是太棒了。</p><p>所有的东西都在我的掌控之中</p><p>比之前的那个奇怪的admin版本要好不知道多少倍</p><p>这下感觉终于可以开始用起自己的博客系统了，！</p><p>当然还有每日作品和项目系统！！！！真的真的真的好棒啊。这种成就感，nodejs从框架开始都是自己写的的这种自豪感。</p><p>呼呼呼呼</p><p>（深夜放毒）</p><p>唔最近沉迷阴阳师无法自拔（咦哪来的时间写代码？）</p><p>话说Humanity真的好好玩啊</p><p>转学的事情也在（好像）稳步进行中？</p><p>我要加油。</p><p>或许这篇文章就写给自己看吧</p>',20,0),(7,'fff2b12c-8d41-11e6-80c4-e5922c263bb3','Liby99',2,'2016-10-10 11:28:00','2016-10-09 14:22:35','感觉反思性的文章不太适合写在这种地方','不过我先写一篇再说','Think','<p>文题无关（。不过这个可以用来做个封面。看起来......网站的整个框架都搭好了呢。</p><p>唔现在又到了凌晨3点钟，基本上一天都没跟人说话，一直在写这鬼网站。嘛这倒是跟我说的“现充=零生产力”相符合呢。这一段话大概会被用来测试博客的样式。不过现在看来还挺好看的。不过这一段我一定要写的非常长才行。再稍微乱说点话，今天中午去CSSA开会的时候还是挺好玩的呢，感觉终于有种要开始做有趣的事情的感觉——啊不，其实一直都在做有趣的事情，但是好像我都没能把自己的精力投放进去呢。</p><p>话说又看了看ashthorp.com那上面的作品，又被惊到了，果然这个还是要一直在做才行呢。</p><p>估计要睡觉了。那就拿这篇文章作为这个博客系统开启使用的纪念吧（虽然好像还是有很多bug）。</p><p>嗯我继续加油。</p><p>话说我想继续拿这篇文章做点实验。</p><p>以下是代码：</p><pre>#article-content pre {\n    padding: 20px;\n    line-height: 20px;\n    border-left: 1px solid rgba(200, 200, 200, 1);\n    background-color: rgba(245, 245, 245, 1);\n    font-family: \'Menlo\';\n}</pre><p>还想有点quote：</p><blockquote><p>\"You will never win\" - Liby</p></blockquote><p>再长一点的代码呢？</p><pre>        //Generate request object\n        this.request = new XMLHttpRequest();\n        this.request.open(\"get\", this.url, true);\n        this.request.responseType = \"arraybuffer\";\n        this.request.addEventListener(\"progress\", function (event) {\n            if (event.lengthComputable) {\n                self.updateCircleSize(event.loaded / event.total);\n            }\n        });\n        this.request.addEventListener(\"load\", function (event) {\n            self.downloading = false;\n            self.downloaded = true;\n            self.data = new Uint8Array(this.response);\n            BeatMap.checkDownloadFinished();\n        });\n        this.request.addEventListener(\"error\", function () {\n            self.abortDownload();\n            alert(\"Package \" + self.name + \" download failed.\");\n        });\n        \n        //If the request is sent then set the downloading to true\n        self.downloaded = false;\n        self.downloading = true;\n\n        //Send the request\n        this.request.send(null);<br></pre><p>这应该就是全部了？？好吧再加一点标题：</p><h1>这个就是大标题！</h1><ol><li>阿斯顿发</li><li>应该有第二条的</li><li>这是第三条</li></ol><p>嗯看起来这个数字列表没问题了。还有普通的列表：</p><ul><li>asdfasdfasdfa</li><li>阿斯顿发玩得真爽</li><li>阿斯顿发水淀粉</li><li>阿斯顿发啊啊说</li><li>asdfasdf</li></ul><p>阿斯顿发，，，，，阿斯顿发阿斯顿发阿斯顿发生</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"010.jpg\" style=\"width: 711px;\"></p><p>又来了一张图片。真好。</p>',273,1),(63,'85f0634e-8db2-11e6-80c4-e5922c263bb3','Liby99',1,'2016-10-12 04:54:00','2016-10-23 18:40:01','所以，要创造','卷首语','Think','<p>虽然这一篇文章的原文已经是半年前的东西了，但是现在看到的时候还是想重新发上来。话说那个时候我也在制作自己的个人网站，当然，在现在看来是相当幼稚的作品，但是那时的我却也怀着和现在一模一样的本心。</p><blockquote>“当你停止创造，你的才能就不再重要，剩下的只有品味，品味会排斥其他人，让你变得更狭隘。所以，要创造。”——Ruby</blockquote><p>过去的这一段时间，我也和大部分人一样，不得不面对很多够呛的事情。够呛能申请上顶尖的大学，够呛能够维持4.0的GPA，够呛能在如此纷繁的世界中不忘初心。事实上，是有很多事情让我们很被动地够呛。就像只能拼命地把以前的试卷刷完以能在现在的考试中拿到高分、只能拼命地赶稿子以为了维持自己工作的职位、或者只能尽量地去进行社交，让自己不至于与世界脱轨。但是，仔细想想的话，更多的够呛，还是来自于自己。</p><p>总感觉，这个世界总会把我们拖入无可救药的平凡中——就连怀着“希望成为不平凡”这个想法这件事本身，都是再平凡不过的事情了。写程序时遇到难解的Bug，便顺手从抽屉里拿出PS4的手柄开始“放松”；说好每天练习绘画，每天弹琴，却经常因为大学的作业而搁置；就连登上Pixiv，Behance上面看看大神的作品，都会败给自己心中的自卑。赞叹一下他们精湛的技艺，娴熟的技巧，想着，“自己永远不可能达到这个地步了吧”，然后便回到自己无聊的日常。家人常跟我说，“学会放弃”。嗯，这看起来是一个非常好的理由。是啊，我们怎么能去跟世界上最顶尖的人才比呢？果然还是轻松快乐地过完自己的一生吧，嗯。</p><p>但真是够呛，心中，居然总是有种不屈，让我注定没办法闷在日常的被窝里享受慵懒的上午。窗外的太阳照耀着，四周的鸟儿争鸣着，楼下的人们喧闹着，无不在呼唤着我不甘的内心，催促着我一定要逃离舒适的日常，去踮起脚来够那些我够不到的东西！没准通过十年的努力，我也可以轻松驾驭各种平台的开发；或许通过十年的努力，我便可以信手拈来色彩饱满构图精妙的二次元插画；或许通过十年的努力，我便可以熟练地进行建模和人物动画，制作自己的3D游戏或电影；或许通过十年的努力......总有这样的声音在我心中回荡，让我不停地敲击着键盘，让我拿起手边的数位板，或让我打开Cinema 4D逼着自己迸发灵感。生到现在，我还从来没有真正地获得过什么，不是么？那么现在，不就应该，踮起脚来，去够到那些我够呛才能获得的东西吗？</p><p>于是这个网站便在这种想法下诞生了——不用说，网站也是很久之前就想写了，但是以前输给了自己的怠惰。创造它是艰辛的，是够呛的，但仔细想想，这仅仅是一隅而已。远方仍然有着万千的精髓，等着自己去够。尽管自己已经平凡地不能再平凡了，我依旧要踮着脚，去够那些够不到的东西啊。那么希望从现在开始，这个网站可以见证，我在这条够呛能成的路上，踮着脚创造的痕迹吧。</p><p>虽然踮着脚挺累的，但是像我们这样倔强的人，必须一直踮着脚，创造下去啊。</p>',277,1),(64,'e55d7d75-981a-11e6-8ff8-f23c91f189d6','Liby99',1,'2016-10-21 23:00:00','2016-11-07 23:35:22','Liby.me V2.0 发布','开发摘要','Developement, Liby.me','<p>好，这个个人主页的完全版终于做完了，接下来说一下其中的开发细节</p><p>（咦网址哪里不对？</p><p>（坑爹的阿里云封死了我远古时期的账号，神**要我拿着身份证拍照验证。只能回国再搞这事了。</p><p>整个网站都是完全用NodeJs开发出来的。之前写了一个老的版本，因为很难做框架，不想要每次都app.get(\"...\", function () {})，所以完全采用了静态页的方式。可是这样的话各种代码量都超级超级大，而且写的一点都不Decent。当时开发各种碰壁，于是后来直接就弃坑了（噗噗</p><p>然后我就开始在各种方面研究NodeJs和Express这几个鬼东西。中间也做出来了几个自己的试验品，也包括<a href=\"http://manga.cubes.studio\">MangaReader</a>之类的，慢慢整出来了一套自己的NodeJs框架，然后页面的渲染就变得相当简单，而且代码也非常明了了。当然，经常还是会出现Callback Hell的状况，所以我总是在期待ES 2017的Await Async。中间还想去用Babel（简直作死）。不过果然还是算了。还是揪着原本的Express和NodeJs不放吧。</p><p>那么现在就来说说一些小细节（？</p><h2>后台</h2><p>自己写的框架的话，最主要的部分应该就是Router吧：</p><pre>var file = req.path.substring(1, req.path.indexOf(\".html\"));\ntry {\n        \n    //Check if there\'s a route written\n    var route = require(\"../route/\" + file + \".js\");\n    \n    //Call the router\n    route(req, res, function (data) {\n            \n        //Render the data and the file\n        res.render(file, data, function (err, html) {\n                    \n            //Error handling\n        });\n    });\n}</pre>\n<p>把所有的html的链接都截下来，然后获取相应的Router来处理这个html的内容，而router将一定会给callback function返回这个页面所需的数据，从而直接调用res.render(data)来渲染这个文件。</p><p>（catch的部分则是可以直接发送静态的html的了，当然还要避免404的循环重定向。这个bug整了我挺久的）</p><p>于是比较简单的Router都会非常简洁地长成这样：</p><p>例：project.js</p><pre>var Project = require(\"../api/project.js\");\n\nmodule.exports = function (req, res, callback) {\n    Project.getThreeProjects(function (projects) {\n        callback({\n            \"projects\": projects\n        })\n    });\n}\n</pre>\n<p>于是这就是一整个Router了，因为把获取project信息的方法封装在API里，所以只需要调用api里的方法，再把东西放回到callback就行。</p><p>（不行哈哈哈哈我越来越觉得这个Router真是太Decent了）</p><p>然后就是Ajax的请求（们），我也写了相当不错的Handler，于是Ajax的请求和撰写就变得非常简单啦！以下是Ajax的模组：</p><pre>    try {\n        var handler = require(\"../handler/\" + req.params[0] + \".js\");\n        if (req.query[\"action\"]) {\n            if (typeof handler[req.query[\"action\"]] === \"function\") {\n                try {\n                    handler[req.query[\"action\"]](req, res);\n                }\n                catch (ex) {\n                    console.log(ex);\n                    res.error(417, \"Expectation Failed\");\n                }\n            }\n            else {\n                res.error(404, \"Action \" + req.query[\"action\"] + \" Not Found\");\n            }\n        }\n        else {\n            res.error(404, \"No Action Specified\");\n        }\n    }\n    catch (err) {\n        if (err.code === \"MODULE_NOT_FOUND\") {\n            console.log(err);\n            res.error(404, \"Handler \" + req.params[0] + \" Not Found\");\n        }\n        else {\n            res.error(500, \"Internal Server Error\");\n            throw err;\n        }\n    }</pre><p>以上的这些代码将会为一个格式的请求：</p><pre>/ajax/&lt;HANDLER&gt;?action=&lt;ACTION&gt;</pre><p>自动找到相应的handler然后调用其中的action方法。所以我们不需要一个一个写app.get()！</p><p>这些奇妙的res.error就是专门为Ajax请求封装的格式化的办法，这样在前端调用Ajax请求的时候也可以有封装方法，能做到自动处理异常呢，就不需要每次请求都一个个写了。</p><p>总之后台的理念就是，框架之外的代码越少越好，于是我写后台的时候一直都是处于速度飞快的状态。自己使用自己的框架真的很愉悦呢。</p><h2>前端</h2><p>哈哈哈到前端......其实......突然发现......好像没啥好说的？所有的html都是使用ejs这个渲染引擎来做的渲染（完全是以前开发Asp.net留下来的后遗症）。一般来讲的话，ejs的使用还算是挺不错的，但是这次遇到了一个博客页分页的问题，还有作品页要分月份和分列的问题。在这些问题上，ejs的做法都不怎么decent。不过我倒是有点想展示一下Pagination的代码：</p><pre>&lt;ul id=\"pagination\"&gt;\n    &lt;% if (page != 1) { %&gt;\n        &lt;li class=\"page-btn op\" id=\"page-prev\"&gt;\n            &lt;a href=\"article.html?p=&lt;%= page - 1 %&gt;\"&gt;&lt;i class=\"fa fa-angle-left\"&gt;&lt;/i&gt;Prev&lt;/a&gt;\n        &lt;/li&gt;\n    &lt;% } %&gt;\n    &lt;% if (max_page &lt;= 5) { %&gt;\n        &lt;% for (var i = 1; i &lt;= max_page; i++) { %&gt;\n            &lt;li class=\"page-btn&lt;%= (i == page) ? \" active\" : \"\" %&gt;\"&gt;\n                &lt;a href=\"article.html?p=&lt;%= i %&gt;\"&gt;&lt;%= i %&gt;&lt;/a&gt;\n            &lt;/li&gt;\n        &lt;% } %&gt;\n    &lt;% } else { %&gt;\n        &lt;% if (middle || right) { %&gt;\n            &lt;li class=\"page-btn\"&gt;\n                &lt;a href=\"article.html?p=1\"&gt;1&lt;/a&gt;\n            &lt;/li&gt;\n            ...\n        &lt;% } %&gt;\n        &lt;% for (var i = start; i &lt;= start + 4; i++) { %&gt;\n            &lt;li class=\"page-btn&lt;%= (i == page) ? \" active\" : \"\" %&gt;\"&gt;\n                &lt;a href=\"article.html?p=&lt;%= i %&gt;\"&gt;&lt;%= i %&gt;&lt;/a&gt;\n            &lt;/li&gt;\n        &lt;% } %&gt;\n        &lt;% if (left || middle) { %&gt;\n            ...\n            &lt;li class=\"page-btn\"&gt;\n                &lt;a href=\"article.html?p=&lt;%= max_page %&gt;\"&gt;&lt;%= max_page %&gt;&lt;/a&gt;\n            &lt;/li&gt;\n        &lt;% } %&gt;\n    &lt;% } %&gt;\n    &lt;% if (page != max_page) { %&gt;\n        &lt;li class=\"page-btn op\" id=\"page-next\"&gt;\n            &lt;a href=\"article.html?p=&lt;%= page + 1 %&gt;\"&gt;Next &lt;i class=\"fa fa-angle-right\"&gt;&lt;/i&gt;&lt;/a&gt;\n        &lt;/li&gt;\n    &lt;% } %&gt;\n&lt;/ul&gt;</pre><p>这样子就能产生，有首页，尾页，并且中间有五个相邻页，还有“上一页”，“下一页”的pagination。其中我觉得比较有趣的是left, middle和right三个变量。本来这个逻辑写得相当混乱，到处都是for和if。但是有了这三个变量——分别指代当前页码是否属于左，中，右部分——之后就只需要一点点多余的代码就可以了。看起来还算是比较舒服的。</p><p>嘛，然后就是我觉得这个个人主页最为有创意／技术含量的地方，那便是首页和作品页上的鼠标滑动效果。最开始见到这个效果是在苹果的官网，有个Start Something New的页面。但是很可惜现在已经找不到了。当时还相当认真地读过他混淆的代码，想要找到里面最关键的部分到底是啥，不过实在没有成果。于是我就只能自给自足了（其实是先有想法模仿这个效果然后才想做主页的我会告诉你们吗？）</p><p>嗯整个Module已经被封装的比较全，所以我就只取能表现它运动模式的代码出来吧：</p><pre>bx += (mx - bx) * ANIMATION_SPEED;\nby += (my - by) * ANIMATION_SPEED;\n\nif (Math.pow(mx - bx, 2) + Math.pow(my - by, 2) &gt; 1) {\n    setBoardPosition(bx, by);\n}</pre><p>铛铛！其实就这么点（甚至最后一个if都不需要去看它。</p><p>用到的是牛顿逼近法！（上几个学期才学的微分方程），这里ANIMATION_SPEED是一个0-1的double值，其实意思是，在下一帧，我将会走应该走的距离的几分之一。比如如果ANIMATION_SPEED是1/2的话，那么我第一帧就会走整个距离的1/2，第二次因为只剩1/2了，再乘以1/2就会变成1/4，第三次则是1/8，以此类推。我最后设置的速度是1/25，这样的速度应该不会很快也不算慢。</p><p>所以说如此流畅的动画其实就只用了这么一点微小的技巧( ´ ▽ ` )</p><p>再就是这每个页面的responsive真是整的心累。</p><p>嘛，就这样吧，大部分有趣的技术细节也都说到了，如果还对什么部分感兴趣的话，一定直接发邮件来问我哦～</p><p>开发这个网站真的很开心，也非常感谢所有向这个网站提出过建议的民那桑～下次再见～（咦？下次？</p>',123,0),(65,'c3273e9c-a0d4-11e6-8ff8-f23c91f189d6','Liby99',1,'2016-11-02 01:00:00','2016-11-03 05:28:06','Gitbook 搭建完成','My Own Gitbook','Development, Gitbook','<p>上周去了LMS刘大师家里玩，聊到想要建立自己的知识储备库的问题，并看到了Gitbook这个东西。瞬间觉得它的网站写得好漂亮啊，这样。（虽然刘大师可能觉得只是很普通的网站而已（捂脸））</p><p>于是今天就开始自己建了一个Gitbook的服务。以为会是很简单轻松的搭建，但事实上还是花费了一点小功夫。大概花费了一个多小时解决了一些奇怪的问题之后，整个网站也算是搭建完成了。如果想要访问的话，直接点击我个人主页右上角的Gitbook，就会直接打开Gitbook的链接了。我专门写了一个有点长的文章，讲在CentOS上如何使用NginX，NodeJs和PM2来搭建一个Gitbook Server:&nbsp;<a href=\"http://gitbook.liby.cubes.studio/gitbook-setup.html\">http://gitbook.liby.cubes.studio/gitbook-setup.html</a>，不过这不是重点（不是应该写在博客里的东西）。主要是觉得，知识储备还是相当重要的一件事情。上了大学之后觉得自己学的知识一天比一天多，有许多时候会找到一些网站，看到一些信息，但是转眼间就记忆不是那么清楚了，再想找回那个网站或者那个pdf就相当困难了。比如说常找到的一些关于抽象代数的证明啊、一些Linux指令的妙用啊之类的。这个时候果然还是有一个云端的知识库比较好。Gitbook还有一个非常大的好处，就是比起普通的Markdown，它居然还可以写数学的表达式～！这样子记载一些数学上的证明之类的应该也会方便很多。当然记载代码什么的都是非常正常的事情啦～如果大家觉得方便的话也可以自己去建一个Gitbook呢（或者自己从头开始写一个自己的Wiki？）。当然，Gitbook纯粹是为了知识的储备作用，正常的博客文章还是会写在自己的网站上的，嗯。</p><p>更新：Math的部分并不是自带的，而是需要装一个MathJax的插件。插件的编译需要GCC，然后我惊人的发现我服务器上的GCC居然是坏的。重新装了一遍于是好了。能看到LaTex的东西在网站上真是太舒服了。</p><p>P.S. 明天就要去参加Adobe MAX 2016了我好兴奋啊！</p><p>P.S.S. 怎么还不睡觉 明天要起不来了啊喂</p>',51,0),(66,'fd1e3e77-a184-11e6-8ff8-f23c91f189d6','Liby99',1,'2016-11-02 22:18:00','2016-11-04 08:40:57','2016 Adobe MAX Day 1','首日：Keynote, Sessions and Pavilion','Adobe, MAX, Creative','<p>11月2号仍没有结束。我刚到家，整理好自己的心情。也许是许久没有这样出门了，今天突然觉得有点不适。不过所幸Adobe MAX还是让我收获了许多东西。</p><p>早上难得6点钟就起床了，做好了翘掉这几天所有的课的心理准备之后，搭上去San Diego Downtown的Uber（是这是我在\"San Diego\"读书一年多以来第一次进城），到达了Adobe MAX的会场，San Diego Convention Center。进去首先是拿Badge（胸牌），看见别人脖子上挂的绳子都是黑色的，上面有Adobe，Microsoft Surface和CDW（Actually I have completely no idea what this company is）的图标，然而到我领胸牌的时候，工作人员跑好远帮我拿了一个橙色的奇怪的挂绳过来。我一直在担心他们会不会特别对待购买学生票的群体（这牵扯到最后有没有可能拿到礼物）；那时我便觉得，自己好像真的被区别对待了——放眼望去，除了我以外居然一个橙色的挂绳都没有。说到拿Badge的时候也算是送了东西。但并没有想象中那样能拿到一个鼓鼓囊囊的袋子，里面装着Surface Pro或Canon单反；而只是一个普普通通扁扁平平的袋子，甚至我觉得连设计都不是很好看。往里面看了一眼，不过是一些赞助商的卡片罢了。</p><p>San Diego Convention Center比香港的亚博还要大哦，来到早餐的会场真的想起了当年考SAT万人坑的情景——这次Adobe MAX也有10,000人参加啊！我随便找了一个空桌子坐下，不久桌上便陆陆续续坐了五个人。不消说，他们都是产业中的人。这几个人里面也有前几年来了Adobe MAX的。他们都不约而同地说起前几年送的surface、相机、手机之类，抱怨道今年好像没有这些东西。于是我们都开始期盼起在接下来的Keynote中，我们仍有机会收到传说中的好东西。介绍自己的时候，我发现他们的工作都大同小异，在公司里做产品部门的设计师，大部分时间都在做Print，有的时候要做Web的UI/UX，很少时候会剪辑一点点视频。就算说了自己做Web，他们也都说自己对代码并不那么在行，都在用Adobe Muse（我问起Dreamweaver的时候，他们也说不会用（是因为Dw其实需要你真的写代码嘛？））。当我说起我会用After Effects，Blender和Cinema4D，他们则都感到震惊。虽然仍没有给他们看我的主页或作品之类的，但他们还是觉得我好像挺厉害。有个人说他在Udemy上面买了一些课程，但是到现在都一直把视频放在那，还没看呢。但是除去自己的实力，说到产业，这堆人就有得说了。什么公司让某些员工一周只用来公司三天，什么公司不给他涨薪的机会，什么公司遇到他这样的设计师就把所有大大小小的任务交给他，还有一个Freelancer老爷爷大谈阔谈自己以前是如何处理同事之间的关系之类。这个老爷爷最后还“语重心长”地对我说，\"As a student, you are here to absorb, absorb, and absorb\"，啊我知道你见得多啦，我知道我还是个小毛孩，然而你为啥说起3D的时候就只说123D呢？C4D、Maya、Blender都被吃掉了......</p><p>然后就到最激动人心的Keynote时刻（并不）了。前前后后介绍了一些Mobile App像Photoshop Fix, Photoshop Sketch, Lightroom之类的，都不算什么新发布了。又介绍了个新的Xd，全称应该是Experience Design，这个我在展会的电脑上试了一下，还是挺有趣的东西。还有个新的Fe，Felix Project，也就是把3D渲染也加入Adobe的工作流程中。说起来我当时看到这个图标和3D兴奋得要跳起来了，，，，，，然而只是个普通的软件而已。我应该说......Fe大概跟Video Copilot的Element 3D差不多水平吧......（说到Felix我想起来Re0里的伪娘菲利克斯这有问题吗）。说完了一些平面和交互设计之后，终于出现了我最感兴趣的After Effects和Premiere的部分了。Premiere在渲染After Effects模板和调色方面的功能增强了很多（虽然我调色还是会用Ae，毕竟跟Compositing是一起的），而After Effects则是增强了它在3D方面的能力——它又扩展了好多Cinema4D的接口，看起来相当不错。不过最值得一提的应该是那位演讲者了吧，他居然一边讲话一边唱歌，台下的人真是笑得停不下来。大家有时间也去看看Adobe的Keynote吧，真的是相当不错相当有感染力的演讲～～哦，又想起来个有趣的事，在用Xd的时候，台上的两个演讲者开始使用两个电脑做协同合作的Demo。其中一个“设计师”在海浪的青蓝色背景上面把字改成了红色！<font color=\"#ff0000\" style=\"background-color: rgb(0, 255, 255);\">红色</font>！当时我身后的人突然就大喊\"NO, NO, NO, NO, NO MORE THIS F****** RED\"（原来这就是设计师的境界吗！）我们四周的人听到都笑喷了，简直停不下来。（到最后这个演讲者也没有把红色换回来。没准我们可以认为他并不是专业的设计师？）。</p><p>从Keynote来说，感觉Adobe的趋势是越来越把这个极需专业素养的工作流程变得越来越简单。Photoshop和Lightroom都加入了许多一键***功能（就像某gram）；所有Ps，Xd，Pr这些软件都专门为各种社交软件优化；Felix的3D居然就只是魔棒、改个颜色、换个贴图的工作（在Blender里面的Texture Node，Cinema4D里面的Texture Layer都不见了踪影）；而看起来新发布软件里面“最复杂”的Xd，在我看来也就只是复刻了一个Sketch而已（不过我相信Adobe这次肯定会获得很多用户，比如我）。作为一个至少有一点点专业素养的“设计师”，我总觉得Adobe这样只是在拉低创意产业的逼格。当然，这也有可能是我个人自视清高；但至少在3D方面，Adobe在演讲中无数遍提到3D不好，想要尽可能简化3D的创作流程，创造了Felix这种“Simple but Powerful”的工具。于是在我看来，他们演示的3D作品简直就是......垃圾......。如果一个想要涉及3D的设计师不想去学习Maya、3ds Max、Cinema 4D、Blender这样的软件，那他搞3D干嘛。对于这种专业素养很高的工作，我真的从来不觉得Simple和Powerful可以共存。</p><p>吃完午饭转眼就到了下午要去听session的时间。中间在大厅的Pavilion转了转，不幸仍未看到传说中的\"Free Gear\"。会场倒是相当热闹，各种队伍都有很多很多人在排队，四处都可以拿食物，酒水饮料，披萨，炒饭，甜点，水果，应有尽有。期间稍微看了看大疆的小飞机，新的GoPro，微软的Surface Studio（Unfortunately the Dial doesn\'t seem that astonishing to me）。不过因为时间紧急，很快就离开了Pavilion，向Convention Center的二楼行进。</p><p>下午我总共参加了两个Session。第一个是After Effects的Tips and Tricks，演讲者是Ian，看起来像是十分有经验的一个人。本来我觉得我Ae已经掌握地相当不错了，然而惊人的，这次的session我居然还学到了很多东西——像是一些快捷键，Mask和Blending Mode的妙用，Path和Mask和Keyframe的转换，之类的。不过，嘛，我一直都知道After Effects有很多奇妙的隐藏用法，所以说就算学到了这些我也毫不惊讶。或许我会在之后做的一些小作品上面试试。第二个Session的题目是\"1% Inspirations, 99% Design Thinking\"。本来这门课超级火，火到waitlist都进不了，然而因为我是学生（哈哈哈）于是我很轻易地就进去了。标题Design Thinking，嗯......sounds legit，就像牛顿的“1%的天才和99%的勤奋”一样，对于我们这些普通人来说绝对是值得去学习的。我们被分成了很多组，每一个组围着一个圆桌子。（每张桌子上都有一台iPad Pro和一支Apple Pencil（谁说苹果从来不赞助Adobe来着））。嘛，整个“课程”的目的就是让我们在三个小时之内想出一个问题的解决方案——这次，他们选择了”如何让Adobe MAX的参加者能更轻易地记住自己遇到的人的名字“这个问题。好啊，看起来是个不错的问题，我也想记住更多人的名字，以建立我的“人脉”。我其实相当期待的，能在这个过程中跟这些设计师/PM们学到很多很棒的Design Thinking Techniques。然而......我发现，结果上来说，几乎所有的组都把自己的视角放在1. 可穿戴设备（含Glasses这种VR），2. 人工智能的面部识别和语音识别， 3. 让记忆游戏化（Gamification）。这真的让我相当失望，堂堂Adobe MAX世界年度大会，一个session上15个小组，每个组里有那么多的厉害的公司的项目经理，居然思路就跳不开这些所谓的“技术前沿”。令我更加失望的是，我，居然一点其他的主意都没有。</p><p>下楼中途遇到了一架三脚架钢琴，便坐下来弹了首Un Sospiro。虽然中间有挺多错音（指甲也没剪，实在没弹好），但是弹完之后还是有挺多人鼓掌并且过来说Awesome的。有个大叔跟我说他录了视频，想要我的手机号码以便发给我。之后他还发来短信说，“What\'s your name in case you ever become famous. ”。えへん～～～</p><p>晚上则是和学长学姐们一起逛Pavilion。终于体验了一把VR的3D Painting，看到了真的3D Scanning，还买了个可爱的Ps小抱枕（架子上的最后一个哦！）（抱枕真的好可爱）（Ps真的好可爱啊）（哪里不对？）。这时我们终于发现了我脖子上挂的橙色吊绳到底是什么意思——原来我是21岁以下啊！学姐到吧台面前，还什么话都没说，吧台的小哥就问“你是想要可乐还是雪碧”——明明你身后摆的全是酒啊！当时真是笑了个半死。原来这个橙色的吊绳是为了避免我们拿酒（。随便在涂鸦墙上画了点画，拍了一下纪念的照片，比较辛苦的一天就结束了。学姐最后还有点走不动路了，真是辛苦了。学长开车把我们送回了家，姑且继续期待明天的Sessions（和传说中的Free Gear！！）吧～</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"名称未設定.jpg\" style=\"width: 1151px;\"><br></p>\n                        \n                    ',96,0);
INSERT INTO `article` VALUES (67,'75ef49ee-a268-11e6-8ff8-f23c91f189d6','Liby99',1,'2016-11-04 01:00:00','2016-11-07 23:26:18','2016 Adobe MAX Day 2','第二日：Keynotes, Session and Bash','Adobe, MAX, Creative','<p><span style=\"line-height: normal;\">今天早上</span>还是有点怠惰。虽然六点钟闹钟就响了，我居然醒来在微信上发了个信息，把闹钟关掉，继而又一次睡去了（完全没有意识啊喂！）。再醒来的时候惊觉已经九点，赶忙爬起来洗漱，叫上一个<span style=\"line-height: normal;\">Uber便</span><span style=\"line-height: normal;\">赶去了会</span>场<span style=\"line-height: normal;\">——</span>对不起对不起早上七点就开车到我楼下来等我的学长、真是对不起。回到我对<span style=\"line-height: normal;\">Adobe MAX</span><span style=\"line-height: normal;\">最关心的事情上来，</span>结论上来说，我今天还是没有收到礼品。所有人都没有。所幸今天收获也是很大的。</p><p><span style=\"line-height: normal;\">早上的第一节</span><span style=\"line-height: normal;\">session</span><span style=\"line-height: normal;\">貌似已</span>经错过了，但是还能赶上<span style=\"line-height: normal;\">Creative Keynote</span><span style=\"line-height: normal;\">。</span>进入会场本以为得站在万人坑的后排，但是工作人员很好心地过来问我是不是想要一个座位，然后把我带到一个座位上坐下。这还是挺不错的。我刚刚去看了看官方才发布的Keynote，发现自己其实错过了第一个演讲者，于是就不在这里赘述。但是视频的感染力还真是不如现场的啊。不过你们感兴趣的话当然还是去看看，收获真的很大的</p><p><span style=\"line-height: normal;\">第一个演</span>讲者是一位战地记者<span style=\"line-height: normal;\">Linsey</span><span style=\"line-height: normal;\">。她前往中</span>东，在面对危险的时候，她需要在子弹的幕墙中举起自己的相机，需要用手搬动自己的腿下车催促自己远离危险，还需要跪在武装分子的枪口下恳求生命。她还做了难民的采访拍摄，演讲时，她仍记得每一个她采访过的孩子和村民；记得他们的喜好乐趣，他们的工作起居，乃至他们在病房里的痛苦呻吟。每一个摄影作品都深深地震撼着我们的心灵，以至于最后演讲结束的时候，所有人都致予了最为诚挚的掌声<span style=\"line-height: normal;\">——</span>这掌声与演讲者的幽默带来的掌声不同，与<span style=\"line-height: normal;\">Adobe</span><span style=\"line-height: normal;\">或苹果</span>发布新产品带来的掌声不同，甚至与高雅的艺术能带来的掌声不同<span style=\"line-height: normal;\">——</span>这是有分量的，承载着人们的生命，承载着数不清的文化，承载着人类的未来的掌声。随着鼓掌的声音越来越颤动我的心，前排的观众们开始陆陆续续起立致敬。直到所有我身边的人都起身，我甚至还在犹豫，自己是不是应该站起来<span style=\"line-height: normal;\">——</span>实话说，我写到这段的时候本来是想吐槽自己仍然会屈从于会场的大流。但是现在想想，面对这样的摄影作品的时候，你怎么能够不起身以表达自己的敬意呢。</p><p><span style=\"line-height: normal;\">第二个演</span>讲者是<span style=\"line-height: normal;\">Echelman</span><span style=\"line-height: normal;\">，当今特别火的一位</span>艺术家。她的主要作品是最近非常著名的流动的风的系列<span style=\"line-height: normal;\">——</span><span style=\"line-height: normal;\">使用挂在天空中的网幕来点</span>缀城市和风景。最初我在微信的公众号推送中就看过这一系列设计，当我听说<span style=\"line-height: normal;\">Adobe</span><span style=\"line-height: normal;\">居然把她</span>请到了会场时，我心中是狂喜的。就像许多艺术家一样，<span style=\"line-height: normal;\">Echelman</span><span style=\"line-height: normal;\">的</span>艺术生涯开始于被<span style=\"line-height: normal;\">7</span><span style=\"line-height: normal;\">所</span>艺术学校脆拒。但是她还是相当努力，去从古老的技艺中寻求艺术的精髓。某次她为了赶一个艺术节的展览痛苦不已时，突然从当地渔民的渔网中得到了灵感，于是开始召集渔民做一个非常大的网，并把它挂到了展览会场里。这让她一举成名。西班牙，接着是阿姆斯特丹，伦敦，巴黎，波士顿，华盛顿<span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">在每一个城市，她都是用</span>这个形式在城市的摩天大楼之间，大桥的入口，河流的上空搭起了一片可以让人驻足体会“流动”的天幕。不过其实我想吐槽的是，或许这种工作做多了<span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">就不像</span>创意工作了。我或许会说，在马德里的那个原型是这个作品最为成功的一个，因为它某种程度上代表了这个作品，这个创意的本源。但如果其他城市来找你做城市级别的艺术项目的时候，如果你仍然使用几乎完全一样的想法，那么就有点缺失创意了。更让我有点点失望的是，她居然因为群众和名人们在某<span style=\"line-height: normal;\">book</span><span style=\"line-height: normal;\">某</span><span style=\"line-height: normal;\">tter</span><span style=\"line-height: normal;\">某</span><span style=\"line-height: normal;\">gram</span><span style=\"line-height: normal;\">上的</span>积极反应而自豪不已<span style=\"line-height: normal;\">——</span><span style=\"line-height: normal;\">你或</span>许会说，对于每个人来说，收获赞美都是很值得开心的一件事；但是我仍觉得，作为一个有足够自信和能力的设计师，人们喜爱她的作品对她来说应该是理所应当的事。当然，每个项目她都其实有相当程度的创新，比如跟谷歌合作，让天幕的色彩可以与游客在手机上的点击互动。但她现在正在做的新项目，其实并没有想当年这个项目一样如此的<span style=\"line-height: normal;\">Inspiring</span><span style=\"line-height: normal;\">。</span>这便是我的看法吧，作为一个在自己事业早期获得了<span style=\"line-height: normal;\">Fortuna</span><span style=\"line-height: normal;\">的</span>创意艺术家，她能把这个创意一直做到现在是十分令人震惊的。但或许事实上，这个想法就只是一个<span style=\"line-height: normal;\">Fortuna</span><span style=\"line-height: normal;\">而已。她本人的</span><span style=\"line-height: normal;\">Ego</span><span style=\"line-height: normal;\">和</span><span style=\"line-height: normal;\">Virtu</span><span style=\"line-height: normal;\">，我</span>觉得现在还是并不很强。就等我们以后继续看看吧。不过，演讲结束后，我们惊喜地得知，她在伦敦的流动天幕作品将会被搬到<span style=\"line-height: normal;\">Adobe MAX</span><span style=\"line-height: normal;\">的会</span>场来<span style=\"line-height: normal;\">——</span><span style=\"line-height: normal;\">全</span>场都爆炸了。</p><p><span style=\"line-height: normal;\">第三个演</span>讲者是<span style=\"line-height: normal;\">Quentin</span><span style=\"line-height: normal;\">，昆汀。</span>这应该是整个<span style=\"line-height: normal;\">Adobe MAX</span><span style=\"line-height: normal;\">的</span><span style=\"line-height: normal;\">Keynote</span><span style=\"line-height: normal;\">中最受人期待的</span>环节吧。第一天早上吃早饭的时候就听说了他们都特别期待昆汀的演讲。不过因为我对电影行业并不是那么了解，所以也就不说太多了。不过他确实是非常健谈幽默的一个人。最后有几个小问题他的回答挺有趣的，<span style=\"line-height: normal;\">A: </span><span style=\"line-height: normal;\">“(</span><span style=\"line-height: normal;\">What is a</span><span style=\"line-height: normal;\">)</span><span style=\"line-height: normal;\"> Writer</span><span style=\"line-height: normal;\">?”,</span><span style=\"line-height: normal;\"> Quentin: </span><span style=\"line-height: normal;\">“</span><span style=\"line-height: normal;\">King.</span><span style=\"line-height: normal;\">”</span><span style=\"line-height: normal;\"> A: </span><span style=\"line-height: normal;\">“</span><span style=\"line-height: normal;\">Director</span><span style=\"line-height: normal;\">?”,</span><span style=\"line-height: normal;\"> Quentin: </span><span style=\"line-height: normal;\">“</span><span style=\"line-height: normal;\">God.</span><span style=\"line-height: normal;\">”</span><span style=\"line-height: normal;\"> </span><span style=\"line-height: normal;\">引起台下</span>剧烈的掌声和笑声。（如果我什么时候也能写自己的剧本拍自己的视频就好了）</p><p><span style=\"line-height: normal;\">中</span>间依然是没有什么特别的事情，倒是去看了看<span style=\"line-height: normal;\">Wacom</span><span style=\"line-height: normal;\">的新</span>产品，一个手绘屏电脑，旁边的像<span style=\"line-height: normal;\">4</span><span style=\"line-height: normal;\">代</span><span style=\"line-height: normal;\">iPod Nano</span><span style=\"line-height: normal;\">的</span>转轮可以触摸旋转<span style=\"line-height: normal;\">Canvas</span><span style=\"line-height: normal;\">，有非常</span>赞的<span style=\"line-height: normal;\">4K</span>线视频，有超级棒的笔，还有<span style=\"line-height: normal;\">Quadro</span><span style=\"line-height: normal;\">的</span>显卡。除了其实并不是我特别需要的东西之外，其他几乎都完美。下午参加了一个<span style=\"line-height: normal;\">session</span><span style=\"line-height: normal;\">，</span>讲<span style=\"line-height: normal;\">Premiere</span><span style=\"line-height: normal;\">的</span><span style=\"line-height: normal;\">Advanced Techniques for Editing</span><span style=\"line-height: normal;\">，演</span>讲者是一位<span style=\"line-height: normal;\">UCLA</span><span style=\"line-height: normal;\">的教授（没准我以前想在</span><span style=\"line-height: normal;\">Lynda</span><span style=\"line-height: normal;\">上的</span>纪录片剪辑课程就是她教的）。除了举的例子比较少语言和文字描述过多以外，其实还是非常棒的一个演讲。主要的内容是剪辑技巧，包括<span style=\"line-height: normal;\">Match Cut</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> Jump Cut</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> Flatter Cut</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> J-Cut</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> L-Cut</span><span style=\"line-height: normal;\">之类的，最后她拿了正在制作中的</span>纪录片出来做了一点示范（但是在快捷键上太啰嗦了），居然还拖堂了。或许我以后会在自己的<span style=\"line-height: normal;\">Gitbook</span><span style=\"line-height: normal;\">上把</span>这些技巧都列出来，也多试一下吧～</p><p><span style=\"line-height: normal;\">上完</span>这个<span style=\"line-height: normal;\">session</span><span style=\"line-height: normal;\">赶忙回学校上</span><span style=\"line-height: normal;\">Humanity</span><span style=\"line-height: normal;\">（</span>实在不敢翘啊），然后等着学长来重新把我接去会场参加<span style=\"line-height: normal;\">Adobe Bash</span><span style=\"line-height: normal;\">，也就是</span><span style=\"line-height: normal;\">Sneak</span><span style=\"line-height: normal;\">之后的”</span><span style=\"line-height: normal;\">Party</span><span style=\"line-height: normal;\">”。在</span><span style=\"line-height: normal;\">party</span><span style=\"line-height: normal;\">上我</span>们几个玩的还真挺高兴的。这<span style=\"line-height: normal;\">Party</span><span style=\"line-height: normal;\">开在圣地</span>亚哥会展中心靠海那边的一个小岛上，环境真的特别舒服，我们经过一个长长的走道进到小岛上。有远远地就能望见的<span style=\"line-height: normal;\">Echelman</span><span style=\"line-height: normal;\">的天幕，有四</span>处分散的非常好吃的烤全猪，牛排和冻虾，有回转轨道上的甜点，有用糖果画梵高的画家，还有幽静的树林里一朵朵微明的白莲花下享受海风的情侣们（怒吃狗粮）。哦，据学长说这里的酒还很高级。我们纷纷表示就算没有送的东西，这一个<span style=\"line-height: normal;\">party</span><span style=\"line-height: normal;\">也挺</span>值的了（但是我还是想要送的东西啊啊啊啊啊啊）。语言都比较苍白，还是直接上图：</p><p><img style=\"width: 1055px;\" src=\"data:image/jpeg;base64,\" data-filename=\"a a a a a a a.jpg\"><br></p><p><span style=\"line-height: normal;\">于是就</span>这样，愉快的第二天也过去了。明天主要是上<span style=\"line-height: normal;\">session</span><span style=\"line-height: normal;\">的日子，就</span>让我在这样的大会上吸收更多更多的知识吧</p>',73,0),(68,'cf66fe0a-a309-11e6-8ff8-f23c91f189d6','Liby99',1,'2016-11-04 21:00:00','2016-11-07 23:23:23','2016 Adobe MAX Day 3','终日：Sessions, sessions, and sessions','Adobe, MAX, Creative','<p><span style=\"line-height: normal;\">嗯，</span>That\'s it<span style=\"line-height: normal;\">。没有</span>Free Giveaways<span style=\"line-height: normal;\">。</span></p><p><span style=\"line-height: normal;\">今天有点小开心的事，早上去会</span>场惊觉没有带胸牌，跑去旁边要了一个新的。他们居然给了我一个黑色的吊绳。估计是因为今天已经没有酒可以拿了，所以给我黑色的吊绳也没有关系（</p><p><span style=\"line-height: normal;\">这便是最后一天了，所有人都将重点放到了学</span>习上。虽然学长学姐们都说还是去<span style=\"line-height: normal;\">Pavilion</span><span style=\"line-height: normal;\">玩各个厂家的新</span>产品更有趣，不过我还是把一整天都花在了听课上。其实来说，听课的内容并没有太出乎我的意料。第一节课，本来是学<span style=\"line-height: normal;\">Premiere</span><span style=\"line-height: normal;\">制片的流程和</span>纪录片的讲故事技巧。但不巧，讲师居然还是之前那个<span style=\"line-height: normal;\">UCLA</span><span style=\"line-height: normal;\">的教授。</span>讲课风格依然是相当啰嗦，案例研究还是之前给我们放过的纪录片，就连着重讲解的片段都是之前那节课上过的。有一点比较有趣的内容就是她们配合<span style=\"line-height: normal;\">Creative Cloud</span><span style=\"line-height: normal;\">使用的手</span>动<span style=\"line-height: normal;\">Git Repository</span><span style=\"line-height: normal;\">：她</span>们居然完全用文件名和每个合作者的自觉创建非常清晰的备份，版本管理，还有版本合并。莫名感觉到非常的高端。然而<span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">我</span><span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">估</span>计没有学到什么新东西。第二节课叫做<span style=\"line-height: normal;\">Creative Color Crash</span><span style=\"line-height: normal;\">，主要</span>讲<span style=\"line-height: normal;\">Lightroom</span><span style=\"line-height: normal;\">和</span><span style=\"line-height: normal;\">Photoshop</span>给图像调色的技巧。先不管其他的，他说的有一句话我倒是十分喜欢：<span style=\"line-height: normal;\">The less color</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> the more colorful</span><span style=\"line-height: normal;\">。当你把照片的</span>颜色减少了之后，你希望突出的颜色则变得更加突出。这个十分厉害。但结果上来讲，调色的方法不过于此：<span style=\"line-height: normal;\">Hue Saturation Luminance</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> Brightness Contrast</span><span style=\"line-height: normal;\">,</span><span style=\"line-height: normal;\"> Level Curve</span><span style=\"line-height: normal;\">。虽然到最后有两个小技巧我</span>还是挺喜欢的，比如说先让照片饱和度变低（偏向黑白），使用<span style=\"line-height: normal;\">curve</span><span style=\"line-height: normal;\">增加人物皮肤色，在用</span><span style=\"line-height: normal;\">soft light</span><span style=\"line-height: normal;\">的</span><span style=\"line-height: normal;\">blending mode</span><span style=\"line-height: normal;\">来</span>让人物的嘴唇，眼睛和头发等颜色更加突出。但也就是这个技巧而已啊！第三节课是比较有趣的一堂，一个在产业中工作一万年的人把她在工作中用<span style=\"line-height: normal;\">Photoshop</span><span style=\"line-height: normal;\">做的海</span>报的工程文件一张张打开给我们看每一个层之间的<span style=\"line-height: normal;\">compositing</span><span style=\"line-height: normal;\">。</span>嗯<span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">好吧，我只能</span>这么说。像我这样讨厌<span style=\"line-height: normal;\">compositing</span><span style=\"line-height: normal;\">的人可能真的会很</span>讨厌他们的做法，如果我想要某种效果，那我就从头开始做啊！！！<span style=\"line-height: normal;\">Compositing</span><span style=\"line-height: normal;\">的</span>过程中间有太多太多肮脏的地方了，比如说其实一个街道左右边的墙的透视根本不对，比如说雨中的光效完全就是用一个羽化过的圆形打出来的，比如说人物的头发居然是用<span style=\"line-height: normal;\">random noise</span><span style=\"line-height: normal;\">然后</span><span style=\"line-height: normal;\">find edge</span><span style=\"line-height: normal;\">生成出来的！</span>嗯，没错，这也行吧，我咋一看墙上的海报可能会觉得很炫酷，事实上你也并不能找到很显眼的<span style=\"line-height: normal;\">bug</span><span style=\"line-height: normal;\">（如果</span><span style=\"line-height: normal;\">Compositor</span><span style=\"line-height: normal;\">厉害的</span>话）。但是这算什么？电影中的原来的镜头被修改地可能只用了几十个像素的部分，还到各个<span style=\"line-height: normal;\">stock</span><span style=\"line-height: normal;\">上面去找了奇怪的素材</span><span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">反正我不想</span>这么干。从头开始就把模型建好吧，尽自己最大的努力不要<span style=\"line-height: normal;\">mask</span><span style=\"line-height: normal;\">和做</span>这种肮脏的<span style=\"line-height: normal;\">compositing</span><span style=\"line-height: normal;\">。某些人或</span>许会谴责我说<span style=\"line-height: normal;\">compositing</span>肮脏，然而<span style=\"line-height: normal;\">......</span><span style=\"line-height: normal;\">就</span>连演讲者<span style=\"line-height: normal;\">Lisa Carney</span><span style=\"line-height: normal;\">自己都</span>说自己做的事情非常肮脏！题目叫做<span style=\"line-height: normal;\">Compositing Secrets</span><span style=\"line-height: normal;\">，</span>嗯好，看起来都是不为人知的秘密，在上课前我就已经看到了结局。</p><p>上完课，我并没能来得及再去pavilion一次，就离开了会场。稍微有一点点遗憾，但我估计......不会去参加明年的大会了（其实我尽量？）</p><p>整体上来讲，这个产业都在变得越来越简单。最开始乍一看Adobe的新软件的时候，觉得界面特别简介漂亮——没错，被扁平化了，更顺应现在的一般软件的设计了。这很好，但我觉得不应该在界面变得简单的同时功能也变得简单。在我看来，一个厉害的交互设计师应该努力去学习撰写代码，直接从根源上提升自己能操控用户交互的能力——没有什么交互设计师只需要页面的scroll left和scroll right。我也认为，一个网页设计师也应该去学习代码，而不是只使用Muse来drag and drop。我还认为，一个厉害的平面设计师，如果要做3D，应该直接去学习C4D，3ds Max，Maya，Blender这样的软件，而不是只用Felix来做一点点简单的3D——你对渲染设置一点控制都没有。Adobe不只是软件变简单了，它在大会设置上都特别鼓励人们越来越简单。学长上的Muse课的名字是\"No Coding, No Kidding\"，甚至连他们一定要输入Html head Metadata的时候，老师都让他们不要管它（那网站还有什么用！）。哎......在会上见到的人们多半都是公司付团体票钱来的，想必有很多并不懂创意产业的人也会过来的吧。Adobe这种大会的面向对象应该相当一部分都包括了这样的人，以让更多人买它的产品，于是大会上有一堆一堆的Intro课，像我们这样用Adobe已经有相当经验的人可能都没办法学到自己最想学的东西。</p><p>反过来想想自己想在Adobe大会上学到什么。个人认为第一个应该是人际关系。不过虽然跟很多人强迫自己讲话，但这次并没能跟多少人Networking建立起真的联系。第二个应该是获取一些灵感，可惜，觉得老师上课讲的东西大部分自己都能学会，只是掌握不掌握一个Trick的问题；在Pavilion上或许可以获取一丢丢的灵感，但也没有那么厉害。第三个则是提升自己的能力，嘛，如果说学会一些Trick便是提升了自己的能力的话，那应该算是提升了。</p><p>那我在大会上究竟获得了什么？嗯......仔细想想的话，就是见识吧。在Pavilion上看到了新的产品（虽然都已经基本上知道了），在会上和用餐时跟一些产业中的创意工作者交流了（发现他们都只是公司的员工而已），去听了产业中的名人的一些课（发现他们也都只是人而已，也在用跟我们一样用的工具），somehow知道了这个产业的发展方向是什么（越来越简单）。好了，有了这些见识......并没有什么卵用。自己真正喜欢的那些产业中的大师或民间的大大，像Ash Thorp，Wlop这样的人，他们也一样在使用Adobe的软件。他们并没有来Adobe MAX，但他们的Insights不知道比大会上的这一群人高到哪里去了。回到最根本的，还是一步一步努力提升自己才是最重要的吧。</p><p>おわり</p>',74,0);
