INSERT INTO `artwork` VALUES (3,'467fefd4-8ba7-11e6-80c4-e5922c263bb3','Liby','Golden Particles','And Golden Waves',1,1,2,'https://vimeo.com/156116002','2015-06-20 23:28:00','After Effects','Particle','<p>金色的粒子！灵感来源于某颁奖视频。感觉这个可以被用来当模板。不过以后再说。</p><p>不过这个看起来真不错啊！</p>',21),(4,'9b3c5a2e-8e06-11e6-80c4-e5922c263bb3','Liby','ACES','Redefine your vision',1,1,2,'https://vimeo.com/156116093','2015-11-27 08:00:00','After Effects','ACES, Font','<p>XZMan学长好！这次我的作业做得怎么样咧？？话说这次是参考了一下Ash Thorp的ARES这部短片，那个实在是做的好棒啊，InfoGraphics什么的。我一定要认真学习。</p><p><!-- Description Summernote comes here --></p>',25),(5,'3f4b30ba-8e0a-11e6-80c4-e5922c263bb3','Liby','Particle Field XN','A mess of particles',1,1,2,'https://vimeo.com/156115068','2014-06-02 03:20:00','After Effects','After Effects, Particular','本来想拿很多种颜色的粒子来练练调色，不过感觉这次并没有很成功。原版的灵感......好像没有来源，只是单纯的练习。',5),(6,'e85a0366-8e0a-11e6-80c4-e5922c263bb3','Liby','全てがFになる','Pixelated automata in After Effects',1,4,1,'','2015-11-23 16:00:00','After Effects','Anime, 全てがFになる','实在是很喜欢すべてがFになる这部番，也超级喜欢它的OP和ED。这次仿制的是它的OP片段。嘛说到好看的话肯定是一般般，但是这次的效果有用到Trapcode Form的很神奇的用法。Fractal Noise的算法真的可以仔细学习好久呢。除此之外就是用了Ball Action处理过的字体。是不是显得更加数字感了呢？\n                        <!-- Description Summernote comes here -->\n                    ',6),(7,'69dad440-8f89-11e6-80c4-e5922c263bb3','Liby','Deep Sea','深海&樱花',1,1,2,'https://vimeo.com/156116034','2015-11-23 16:00:00','After Effects','Anime, 櫻子さんの足下には死体が埋まっている, 打ち寄せられた忘却の残響に','<p>超喜欢樱子小姐的足下埋着尸体这一部番，更喜欢打ち寄せられた忘却の残響に这一首歌，番剧的ED，超级推荐，已经循环了好几天了。</p><p>话说我的Particular好像出了点问题，感觉不是很能把樱花的感觉做出来。顶上的闪光是难得一用的Trapcode Shine插件做的。</p>',21),(8,'93db345a-8f8a-11e6-80c4-e5922c263bb3','Liby','Twitching Spectrum Aimer','奇怪的抖动的瞄准器（？',1,1,2,'https://vimeo.com/156114945','2014-02-15 00:00:00','After Effects','After Effects, Sound Waveform','这个奇怪的“瞄准器”，灵感来自于Bionicle Mahri里面的CG动画的开头。还是挺好看的我觉得，虽然单调了点。',4),(9,'f5442008-8f8a-11e6-80c4-e5922c263bb3','Liby','Cool A','只是一个A',1,1,2,'https://vimeo.com/156114910','2013-12-16 16:00:00','After Effects','After Effects','哇现在还能找到2013年做的东西。。仔细想想十大和游园会的视频也是那时做的呢。。有点怀念呢。。这个好像是当年教大红米饭他们的第一个特效。。不过我本身也是从Video Copilot上学来的就是了。。<!-- Description Summernote comes here -->',16),(10,'7d395b7c-8f8b-11e6-80c4-e5922c263bb3','Liby','文乃の幸せ理論','陽炎きゃああああ',1,1,2,'https://vimeo.com/156115026','2014-05-03 00:00:00','After Effects','After Effects, Kagero, 陽炎, 文乃','<p>迷上了阳炎！XDDDDDD</p><p>这一段是想模仿文乃的幸福理论的mv里的一个分镜。mv做的都好赞啊，画风也很喜欢。看看以后是不是可以多仿制几个做练习。</p>',17),(11,'e7807c36-8f8b-11e6-80c4-e5922c263bb3','Liby','夏令时记录','陽炎きゃああああ',1,1,2,'https://vimeo.com/156114976','2014-05-13 00:00:00','After Effects','After Effects, Kagero, 陽炎, 夏令时记录','这就是说好的再做一点关于阳炎的特效，不过这个大部分好像都是自己脑补的。花了很多精力去做云和那种夏日清凉的感觉。大概就是这样（？',6),(12,'45f733ea-8f8c-11e6-80c4-e5922c263bb3','Liby','奇怪的环','就当Element 3D的练习',1,1,1,'','2014-06-11 00:00:00','After Effects','After Effects, Element 3D','其实并不知道自己在做什么。跑到星巴克去乱做一通。嗯我应该滚去写Vinet的代码的嗯。',3),(13,'70cb860a-8f8e-11e6-80c4-e5922c263bb3','Liby','Aim To London','瞄准线',1,1,2,'https://vimeo.com/156115049','2014-06-11 00:00:00','After Effects','After Effects, PPRDMUN, expression','最后这货变成了PPRDMUN 2014视频的主要特效。但这个有趣的点在于，中间那条斜线是用表达式写出来的，于是我们可以拖动中间的准星，线会自动地把起始点和终点连起来。JavaScript真是好玩呢。',3),(14,'f1614dd6-8f8e-11e6-80c4-e5922c263bb3','Liby','Mekaku City Actors','目隠シティアックタース',1,1,2,'https://vimeo.com/156109018','2014-06-24 07:00:00','After Effects','After Effects, Particular','<p>又来啦！阳炎的Mock。这次做的比前两次认真多了呢。我觉得还是挺好看的，配色上来说也是。</p><p>真的好喜欢阳炎</p>',5),(15,'51af7fdc-8f8f-11e6-80c4-e5922c263bb3','Liby','Cataphrect OS','Aldnoah/Zero',1,1,2,'https://vimeo.com/156115082','2014-08-13 00:00:00','After Effects','After Effects, Aldnoah Zero, OS','这次仿制的是Aldnoah Zero第一季op里面迅速闪过去的一幕，是地球的装甲骑兵的os启动界面。我觉得还挺帅的呢！对于这类info graphics加上景深感觉瞬间就不一样了。',3),(16,'6c3b5aa8-9023-11e6-80c4-e5922c263bb3','Liby','Macro Link','Bilibili Macro Link Mock',1,1,2,'https://vimeo.com/156115104','2014-08-16 00:00:00','After Effects','Plexus, Bilibili','最近好像bilibili要搞线下活动。突然想起了自己新搞了个Plexus插件，所以就拿过来用了。好像还算一般好看......',4),(17,'c496bcd8-9023-11e6-80c4-e5922c263bb3','Liby','Throughout the Tube','穿过时空隧道（？',1,1,2,'https://vimeo.com/156115121','2014-08-25 00:00:00','After Effects','After Effects','这次做了这样的一个十分富有动感的动画。其实最有趣的是两边那两个旋转的particle emitter，是用了有相位差的三角函数做参数方程的呢。虽然现在看来也是挺简单的就是了。\n                        <!-- Description Summernote comes here -->\n                    ',5),(18,'aebb173c-9024-11e6-80c4-e5922c263bb3','Liby','Dream','梦',1,1,2,'https://vimeo.com/156115253','2014-08-27 00:00:00','After Effects','After Effects, Element 3D','最近看谜之声玩了一个叫做Dream的游戏。看到最后自己好像都要睡着了，虽然游戏算是“好看”，也很玄幻，做的东西也挺精致的，但是还是有点无聊。不过我突然想起来了它的开场动画，也就是我这次在模仿的东西，果然还是挺好看的。嗯。',4),(19,'0f21d85e-9025-11e6-80c4-e5922c263bb3','Liby','Time','时光流转着唏嘘',1,1,2,'https://vimeo.com/156115273','2014-08-29 00:00:00','After Effects','After Effects, Time','饿。。。并不知道这句词是什么意思，但是说起来好像很好听。我做特效的时间真的过得太快了，不知不觉几天就过去，又什么东西都没有做。这真是太不好了。不过这次的这个特效我真是挺满意的，Lens Blur，一直朝向摄像头的字，用Expression做的表盘和上面指针的动画，还有particular和form做出来的背景粒子，都是真的很有趣的！\n                        <!-- Description Summernote comes here -->\n                    ',6),(20,'966a1f14-9026-11e6-80c4-e5922c263bb3','Liby','Sincerity','阴阳相隔情犹在 魂返红尘与君别',1,1,2,'https://vimeo.com/156115297','2014-09-13 00:00:00','After Effects','After Effects, Hyouka, Sincerity, Umika','灵感取自Umika大大做的Sincerity这个AMV。想仿照那种感觉做出很朦胧梦幻的效果－－想象中，千反田在能从昏暗的那一侧世界亲吻到折木的那一刻的五彩缤纷的世界，大概就是这样的色彩吧。话说我这次真的成功用Fractal Noise做出了云雾的感觉诶。大概是多叠好几层就差不多了。话说回来Umika大真的好厉害好厉害啊。\n                        <!-- Description Summernote comes here -->\n                    ',8),(21,'9a95f8be-9027-11e6-80c4-e5922c263bb3','Liby','Mid-Autumn','中秋',1,1,2,'https://vimeo.com/156115312','2014-09-13 00:00:00','After Effects','After Effects, Mid-Autumn','好像听说学校有人放孔明灯？？然后做了这样的效果。。其实效果很烂，牛顿也哭晕在了厕所。不过模型是用Cinema4D搭出来的哦\n                        <!-- Description Summernote comes here -->\n                    ',12),(22,'a4864968-9028-11e6-80c4-e5922c263bb3','Liby','Through the Universe','开场动画',1,1,2,'https://vimeo.com/156115340','2014-09-17 00:00:00','After Effects','After Effects, Umika','<p>这个灵感是来自于Umika大大在Sincerity中做的第一幕场景。我觉得还原度还是很高的，不过最后少了千反田。</p><p>（后话：现在是2016年2月。刚刚听闻这个十分悲伤的消息。Umika大大居然逝去了。唔我真的好伤心啊，她真的给了我好多好多好多的启发和动力去做视频和特效。真心的，RIP，Umika<br></p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',3),(23,'e3bcba40-9028-11e6-80c4-e5922c263bb3','Liby','Cubes Studio','方块展开',1,1,2,'https://vimeo.com/156115360','2014-10-03 00:00:00','After Effects','After Effects, Cubes Studio','这次为Cubes Studio制作了一个小短片，这个方块及其父子关系其实我觉得用的十分巧妙－－是不是又要说到数学是非常伟大的学科呢。\n                        <!-- Description Summernote comes here -->\n                    ',4),(24,'6cb6dc2c-9029-11e6-80c4-e5922c263bb3','Liby','Sora','Fractal Noise Cloud',1,1,2,'https://vimeo.com/156115398','2014-10-25 00:00:00','After Effects','After Effects, Fractal Noise','不知道为什么突然想用Fractal Noise做一点东西出来。于是就变成了这个样子。果然还是跟云离不开（？Bug太多了。只是放上来凑数的。',3),(25,'bd1732ac-9029-11e6-80c4-e5922c263bb3','Liby','白くな未来','White Future',1,1,2,'https://vimeo.com/156115378','2014-10-25 00:00:00','After Effects','After Effects, Particular','<p>感觉未来就像这动画里的字一样飘散而去了啊，虽然写在那里，但是只是虚无缥缈的幻影罢了。</p><p>（我的申请季T T）</p>',2),(26,'f17ca2a6-902a-11e6-80c4-e5922c263bb3','Liby','Rain','強い雨',1,0,0,'https://vimeo.com/156115456','2014-11-03 00:00:00','After Effects','After Effects, Particular, ks-product','这次仿照了ks-project的一个trapcode particular小实验。这个效果做的真的很满意！\n                        <!-- Description Summernote comes here -->\n                    ',25),(27,'bdc5b5e6-9049-11e6-80c4-e5922c263bb3','Liby','Through Innovation','Abstract Ribbon',1,1,2,'https://vimeo.com/156115844','2015-06-11 00:00:00','Cinema 4D, After Effects','After Effects, Ribbon, Abstract','主要用到Ae中的Plexus插件，Ribbon的模型则是在Cinema4D里面几分钟搞出来的乱七八糟的几何体。其实最后好好调色，好好构图之后这张图显得十分高冷啊。(所以说Innovation其实只是拿来装逼用的（（（（\n                        <!-- Description Summernote comes here -->\n                    ',18),(28,'290a79ae-904a-11e6-80c4-e5922c263bb3','Liby','Colorful Wave','Vector Blur',1,1,1,'','2014-11-03 00:00:00','After Effects','After Effects, Vector Blur','其实实在不好看，也不怎么像波纹，但是技巧倒是十分有趣，Particular + Vector Blur这效果实在很有意思。',18),(29,'55558850-90c7-11e6-80c4-e5922c263bb3','Liby','Obsidian','Be Enlightened',1,1,2,'https://vimeo.com/156116192','2016-02-04 00:00:00','After Effects','Ingress, Obsidian','<p>2016年4月的Obsidian全球大型集会，Enlightened拯救世界的狂欢！虽然这么说，但是这次肯定是参加不了了。还是将这个题材作为练习吧。灵感来自于Ethern君，这次彻底明白了Trapcode Shine的神奇用法。Logo的话则是照搬了之前SMS Enlightment的模型。希望这次的效果能向大家传达出「世界将被绿化」这样的感觉呢～</p><p>P.S.话说回来Ingress的美工死了么＝＝。<br></p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',9),(30,'b1527cbc-90c7-11e6-80c4-e5922c263bb3','Liby','Shockwave Experiment','Shock------',1,1,2,'https://vimeo.com/156115473','2015-02-12 00:00:00','After Effects','After Effects, Shock Wave, Video Copilot','刚搞到了Shockwave的素材包，于是急不可耐地用Element 3D加上破碎的效果试验了一下',17),(31,'928cf896-9425-11e6-80c4-e5922c263bb3','Liby','None','Christmas in the Silent Forest I',1,0,2,'https://vimeo.com/187607292','2016-10-16 21:45:00','Cinema 4D, After Effects, Premiere','Yoko Kanno, Ghost in the Shell, Christmas in the Silent Forest, ','最近突然超级喜欢听Christmas in the Silent Forest这首曲子。菅野洋子的风格真的是赞的不行。想起来前几天又看到Ash Thorp做了点新东西，那个的风格我也是超级喜欢的。受到了一些启发，于是想这次认真剪一个AMV，给攻壳机动队还有可爱的タチコマ。这个片段渲染的话大概就是最后会有的效果吧？就当作预告吧_(:з」∠)_',74),(42,'d7b6c4b8-974c-11e6-a6b8-b6ba83615dae','Liby','Twist Experiment','Element 3D Deformation',1,1,2,'https://vimeo.com/156115491','2015-02-16 00:00:00','After Effects','After Effects, Element 3D, Deformation','看了Element 3D的教程之后就做了这个东西，还算是挺好玩的。这次强行好好调了一次色<!-- Description Summernote comes here -->',18),(43,'e16acde7-9754-11e6-b684-f23c91f189d6','Liby','Trapcode Earth','Digitalized Particle Earth',1,1,2,'https://vimeo.com/156115802','2015-06-12 00:00:00','After Effects','After Effects, Trapcode, Particular','乱做（逃',4),(44,'9a63eea9-976c-11e6-b684-f23c91f189d6','Liby','Right on Attack','Particular Pulses',1,1,2,'https://vimeo.com/156115437','2014-11-30 00:00:00','After Effects','After Effects, Particular','不记得为啥想做这个了，不过好像是某天上物理课乱捣鼓particular，于是就变成了这样。不过也算是比较有动感。',4),(45,'fbe9289e-976c-11e6-b684-f23c91f189d6','Liby','SMS Enlightened','Ingress Enlightened',1,0,1,'','2014-11-15 00:00:00','Cinema 4D, After Effects','Cinema 4D, After Effects, Ingress, Enlightened','<p>这次半推半就地做出来了这样一个Logo（其实并不算），应该是我学C4D开始第一个正式出成果的作品吧。其实就算过了这么久看来，这幅渲染也是相当有趣的。嘛渲染时间也是爆表了呢。话说大家都快点入Ingress坑吧！我们要为人类启蒙而战斗～！</p><p>Be Enlightened and f*** Resistance</p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',3),(47,'ac9a7df6-9808-11e6-8ff8-f23c91f189d6','Liby','Andante','Skywheel',1,0,1,'','2015-02-10 00:00:00','Cinema 4D, After Effects','Cinema 4D, After Effects','看到近期Pixiv上面的活动就想自己拿c4d做一个了。其实这个白模做得有点简单，但是其实从构图和角度来说还是挺好看的～\n                        <!-- Description Summernote comes here -->\n                    ',3),(48,'4554f85b-9809-11e6-8ff8-f23c91f189d6','Liby','Wave','浪',1,0,1,'','2015-04-18 00:00:00','Cinema 4D','Cinema 4D, Wave','<p>海浪倒是模拟过很多遍了，但是这次是在为深中国际2015届的毕业舞会做准备的呢......原来真的快要毕业了啊......略微有点伤感</p><p>这个就只是单纯用了displacement map的海浪</p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',2),(49,'7f3017ca-9809-11e6-8ff8-f23c91f189d6','Liby','Motion','Apple Motion',1,0,1,'','2015-04-30 00:00:00','Cinema 4D','Cinema 4D, Apple, Motion','其实只是在仿制苹果的特效制作软件Motion的图标。话说我怎么在做这东西？\n                        <!-- Description Summernote comes here -->\n                    ',2),(50,'d0bb2209-9809-11e6-8ff8-f23c91f189d6','Liby','K\'s City','雪白的王之都市',1,0,2,'https://vimeo.com/156115732','2015-05-09 00:00:00','Cinema 4D, After Effects','Cinema 4D, After Effects','<p>K一个晚上补完！真的是很不错的一部番，现在看起来第一集开头的CG也是做的相当漂亮！实在忍不住就把它做下来了！其实在建模的层面，感觉上跟原作差不多，但是到渲染的时候感觉就捉急了很多，有的特效和光影不知道该怎么处理。不过单从作品来讲，其实我觉得真的好好看啊！</p><p>BTW伏见好帅(///)<br></p>',3),(51,'1aba5149-980a-11e6-8ff8-f23c91f189d6','Liby','Fuyuki','东木',1,0,2,'https://vimeo.com/156115749','2015-05-09 00:00:00','Cinema 4D, After Effects','Cinema 4D, After Effects, Fate/Stay Night, 冬木','其实并看不出来，只是看到Bilibili上有弹幕在说这个场景是冬木的微缩版（对Cinema 4D来说只是一堆随机摆放的柱体罢了）。这个是来自于Fate/Stay Night的第12集ED的场景之一，很好看不是吗～～～不过好像原作的色彩比我这个昏暗一万倍咯。。\n                        <!-- Description Summernote comes here -->\n                    ',2),(52,'5d799fe6-980a-11e6-8ff8-f23c91f189d6','Liby','Glass Lab 1','玻璃球',1,0,1,'','2015-05-16 00:00:00','Cinema 4D','Cinema 4D, Glass','终于开始搞了点多面体建模－－虽然也没什么难度就是了。画面挺单调不过乍一看还挺好看。玻璃的反射和折射还有大把东西可以搞呢。\n                        <!-- Description Summernote comes here -->\n                    ',4),(54,'de366fa5-980a-11e6-8ff8-f23c91f189d6','Liby','Unlimited Blade Work','Fate/Stay Night 无限剑制',1,0,2,'https://vimeo.com/156115763','2015-05-20 00:00:00','Cinema 4D, After Effects','Cinema 4D, After Effects, Fate/Stay Night, Unlimited Blade Work','<p>灵感取自Fate/Stay Night: Unlimited Blade Work第19集的片尾3D。反光的布景做了好久，效果应该也很不错。其实在C4D渲染的时候并没能达到最后的效果。橙色还是在Ae里面调出来的。感觉材质方面我还需要再多学好多东西。</p><p>话说UBW好燃好燃啊，特效真的做得好棒！士郎很帅，凛酱也很可爱。但我的伊利雅(╥﹏╥)\n                        <!-- Description Summernote comes here -->\n                    </p>',2),(55,'293af374-980b-11e6-8ff8-f23c91f189d6','Liby','Glass Lab 2','Purple Glass',1,0,1,'','2015-06-11 00:00:00','Cinema 4D','Cinema 4D, Glass','Typical Render。不过用了一些deform effectors来整这个。并且仔细看的话上面会有细线，是用材质做出来的\n                        <!-- Description Summernote comes here -->\n                    ',3),(56,'8767ec6b-980b-11e6-8ff8-f23c91f189d6','Liby','Glass Lab 3','クリスタル',1,0,2,'https://vimeo.com/156115857','2015-06-12 00:00:00','Cinema 4D, Premiere','Cinema 4D, Premiere, Glass','<p>这次是突然想到想做一些水晶相关的渲染（最近做的玻璃真多啊（</p><p>技巧的话主要是Reduce Polygon的Effector，多层色彩的材质和物理系统吧。</p><p>晶莹剔透地真的很好看呢。\n                        <!-- Description Summernote comes here -->\n                    </p>',3),(57,'4217dbdc-980e-11e6-8ff8-f23c91f189d6','Liby','Fuyuki Bridge','冬木大桥',1,0,1,'','2015-07-04 00:00:00','Cinema 4D, After Effects','Anime, Fate/Stay Night, Unlimited Blade Work, Fuyuki Bridge','<p>依然是FSN的Mock。这个是来自Fate/Stay Night:<a href=\"ght: \">&nbsp;</a>Unlimited Blade Work的冬木大桥。最近在准备去美国念书了，参加了一下学校华人社团在深圳的活动。这个就是在华侨城的Costa咖啡店里无聊坐着的产物。<!-- Description Summernote comes here --></p>',4),(58,'95c697f4-980e-11e6-8ff8-f23c91f189d6','Liby','Cinema 4D Logo','Mock',1,0,1,'','2015-07-06 00:00:00','Cinema 4D, After Effects','Cinema 4D','<p>用C4D做C4D的Logo（哪里不对）</p><p>我怎么又开始仿制Cinema4D的图标了。不过这个好像几何形状跟原来有点不同。还有反射的内容跟原版也不太一样。</p><p>不过莫名挺好看的（？</p><p><!-- Description Summernote comes here --></p>',4),(59,'f660fc2e-980e-11e6-8ff8-f23c91f189d6','Liby','Excalibur','契约胜利之剑-雏形',1,0,1,'','2015-07-12 00:00:00','Cinema 4D','Anime, Fate/Stay Night, Excalibur, Saber','<p>正常版本的Excalibur！！！！</p><p>这个东西我超认真的去做了的！！！！</p><p>但是实际上如果不是多边形建模的话还是挺麻烦的，挺容易出bug。</p><p><!-- Description Summernote comes here --></p>',4),(60,'1fa644dc-980f-11e6-8ff8-f23c91f189d6','Liby','Wave Lab','水波实验室',1,0,1,'','2015-07-14 00:00:00','Cinema 4D','Environmental, Houdini, Wave','<p>#用于试验</p><p>这次用到了Houdini Ocean Toolbox(HOT)插件。</p><p>它生成的海浪真的非常逼真呢！把Threshold调高了之后真的有一些奇效。除此之外没有什么特殊的技术细节，但是把它渲染好也需要花很多时间哦。\n                        <!-- Description Summernote comes here -->\n                    </p>',4),(61,'67ecc8ad-980f-11e6-8ff8-f23c91f189d6','Liby','Avalon','幻想乡与石中剑',1,0,1,'','2015-07-27 00:00:00','Cinema 4D, After Effects','Anime, Fate/Stay Night, Excalibur, Avalon','诶，是幻想乡嘛？（<br>嘛。总之是想起来以前版本的Fate/Stay Night中好像是有这样的一个场景（？，然后就把它模拟出来了。咦好像应该更绿一点。不过算了，也挺好看的\n                        <!-- Description Summernote comes here -->\n                    ',7),(62,'b8827030-980f-11e6-8ff8-f23c91f189d6','Liby','Assassin\'s Creed Unity Title Screen','刺客信条 大革命',1,0,2,'https://vimeo.com/156189221','2015-09-19 00:00:00','Cinema 4D, After Effects','Game, Assassin\'s Creed Unity','<p>这次仿制的是Assassin\'s Creed Unity的开场动画。那一段3D其实做的真的很不错，只是一般来讲看不出来。这次仿照觉得还是不够还原，但是却不错地把握到了三棱柱和Noise的问题。其实在渲染上应该花更多功夫的。</p><p>说回到Unity，其实我本人还是相当喜欢这部作品（谁让是Assassin\'s Creed脑残粉）不过确实有相当多的地方可以吐槽呢。。希望育碧以后真的要努力啊！\n                        <!-- Description Summernote comes here -->\n                    </p>',10),(63,'5012599e-9810-11e6-8ff8-f23c91f189d6','Liby','Wine & Goblet','酒瓶与酒杯',1,0,1,'','2015-09-30 00:00:00','Cinema 4D','Objects','其实并不知道自己做的到底是不是香槟（（（（（。不过挺好看的不是吗\n                        <!-- Description Summernote comes here -->\n                    ',5),(64,'9172a9dd-9810-11e6-8ff8-f23c91f189d6','Liby','Strawberry','草莓',1,0,1,'','2015-09-30 00:00:00','Cinema 4D','Objects','<p>Typical Render。用了许多高端的渲染技巧，Vertical Map之类的。放了两个简单光源就能做成这样我也挺满意了～</p><p>本来想做一盘草莓，但是效果出奇地差（。估计是每个草莓都长一模一样的原因。</p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',5),(65,'d8da3a68-9810-11e6-8ff8-f23c91f189d6','Liby','Rotative Staircases','旋转楼梯',1,0,1,'','2015-09-30 00:00:00','Cinema 4D','Objects','纯粹的白模。其实就是玩Minecraft模型的时候想做个旋转的楼梯但是发现怎么都做不出来于是跑到了Cinema4D来开挂（大雾（23333<!-- Description Summernote comes here -->',4),(66,'20b7464c-9811-11e6-8ff8-f23c91f189d6','Liby','室内，高光和木质地板','Indoors, Highlights and Wooden Floor',1,0,1,'','2015-10-07 00:00:00','Cinema 4D, After Effects','Indoors','唔。之前搜索室内设计的图片的时候突然被一张画室的图片吸引了。从高大的窗户射入的阳光照射在墙壁和木质地板上真的十分美丽啊。特别像是法国巴黎的室内设计风格。这次花了很多精力尝试还原这样的效果，但是同时做的布料模拟和渲染就显得幼稚很多了呢......后来为了增加画面的色彩把之前做的酒杯的建模和渲染也放进来了。大家觉得怎么样呢？\n                        <!-- Description Summernote comes here -->\n                    ',7),(67,'70180fd8-9811-11e6-8ff8-f23c91f189d6','Liby','Eyeball','Protect your eyeball',1,0,1,'','2015-10-08 00:00:00','Cinema 4D, Photoshop','Objects, Eyes','<p>Take care of your eyes (?</p><p>只是乱做。看到了个血丝的材质特别不错。这样的两个眼珠是不是做的很逼真呢？这次的灵感是来自Youtube上的SioPios阿婆主。其实仔细观察的话，血丝那块做得还是有点羸弱，不过仍然相当漂亮了不是嘛（唔瞳孔好像大了点？）。对了为什么其他人看见这幅图都说好恐怖。。？</p><p><!-- Description Summernote comes here --></p>',4),(68,'adca8f43-9811-11e6-8ff8-f23c91f189d6','Liby','杯具','Teacups',1,0,1,'','2015-10-08 00:00:00','Cinema 4D, After Effects','Objects, Greyscale Gorilla','<p>这次是仿制的GSG上的新Post。做出这样的玻璃细节连我自己都不太相信呢！光线这种东西真是太厉害了。不过除此之外并没能将杯中的茶水的那种颜色调出来呢，本来还想做水里面的浮尘呢。而且最后的调色也显得有点苍白无力，还是要继续努力呢。</p><p>话说最近杯具确实有点多\n                        <!-- Description Summernote comes here -->\n                    </p>',5),(69,'eebbceb7-9811-11e6-8ff8-f23c91f189d6','Liby','Abstract Rings','(?',1,0,1,'','2015-10-10 00:00:00','Cinema 4D, After Effects','Random','这次想要做的是一个奇怪的圆环。但在渲染环节其实出了挺多问题，感觉颜色不太出得来。所以后期狂改－－也没怎么改太好。总体上来说能看就是了\n                        <!-- Description Summernote comes here -->\n                    ',15),(70,'28f9cd12-9812-11e6-8ff8-f23c91f189d6','Liby','Abstract...','I don\'t know',1,0,1,'','2015-11-12 00:00:00','Cinema 4D','Random','Just some random stuff',6),(71,'78243c10-9812-11e6-8ff8-f23c91f189d6','Liby','Fuyuki Bridge #Animation','冬木大桥',1,0,2,'https://vimeo.com/156116143','2015-12-20 00:00:00','Cinema 4D, After Effects','Fate/Stay Night, Unlimited Blade Work, Fuyuki Bridge','将源自Fate/Zero和Fate/StayNight的冬木大桥用Cinema4D建模还原。这次的灵感来源于Fate/Stay Night第12集最后的片尾。不过加了一些自己的东西，让它的色彩更丰富一些，更有震撼感一些。啊那一段片尾有好多好多很漂亮的渲染，真想全部都做一遍啊。话说士郎的魔术回路那里我一直都没有头绪。有谁知道吗？\n                        <!-- Description Summernote comes here -->\n                    ',27),(72,'b813afd8-9812-11e6-8ff8-f23c91f189d6','Liby','Exclibur Remaster','契约胜利之剑',1,0,2,'https://vimeo.com/156116160','2015-12-21 00:00:00','Cinema 4D, After Effects','Fate/Stay Night, Excalibur, Saber','这次重新做了一下Excalibur的动画，主要是在Cinema4D里面做3D动画，然后再到Ae中去加光影效果。其实感觉这次时间有点赶特效没有好好做。等我之后熟悉了X-Particles之后可能可以直接在C4D中整个<del>再</del>重制一遍～～～\n                        <!-- Description Summernote comes here -->\n                    ',30),(73,'ab7ed417-9813-11e6-8ff8-f23c91f189d6','Liby','Glass & Wave','玻璃盆景',1,0,1,'','2016-02-15 00:00:00','Cinema 4D, After Effects','Environmental, Model','这次依然是参考GSG上的Post。实物模型创意Credit自Ben Young。这个做得真是太爽啦～终于可以放入许多许多的小细节，并且让整体感都得到提升！最大的难点当然是制作这个玻璃错位的效果和Boole啦。不像Schmidt，我做的时候这个Boole可是整死我了。放弃了参数化的模型，直接手动把烦人的Boole垃圾清除掉了。嘛总之很好嘛！找回感觉了！\n                        <!-- Description Summernote comes here -->\n                    ',21),(74,'ef1d521b-9814-11e6-8ff8-f23c91f189d6','Liby','Bedroom','卧室',1,0,1,'','2016-03-03 00:00:00','Cinema 4D, After Effects','Indoors','这次狠下心来又做了一次室内渲染。做了许多细节，布料用了物理模拟。不过这个房间整体的感觉跟冬瓜家好像啊，是不是我太常去他们家的原因？最后在墙壁上强行放了一张公主殿下的图以表忠心。这次还是挺开心的，渲染时间也不是很长。\n                        <!-- Description Summernote comes here -->\n                    ',26),(75,'8780a490-9817-11e6-8ff8-f23c91f189d6','Liby','小桥流水','可惜只是白模',1,0,1,'','2016-03-22 00:00:00','Cinema 4D','Bridge, Environmental','这次终于知道了怎么生成随机的小石块，终于知道了怎么让图片变成样条线，终于知道了怎么样做出随机的石头感觉。虽然还是有许多瑕疵，而且还偷懒不做材质，不过这个小石桥的感觉倒是满满。\n                        <!-- Description Summernote comes here -->\n                    ',22),(76,'dcd3c218-995e-11e6-8ff8-f23c91f189d6','Liby','小A','Aces Charater Design',1,9,1,'','2016-09-10 00:00:00','Sai, Clip Studio Paint, Photoshop, Cinema 4D','Anime, ACES, Character Design','<p><img src=\"data:image/jpeg;base64,\" data-filename=\"Process.jpg\" style=\"width: 1126px;\"></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"Untitled-1.jpg\" style=\"width: 960px;\"><br></p><p>啊啊啊啊啊啊啊好开心好开心，第一次这么认真地做人物设计～</p><p>最后也真的如愿被印成看板了～～</p><p>总体来说还算是比较满意的（不要看鞋子，不要看鞋子（</p><p>姐姐大人帮了我很多很多忙，真的非常感谢～</p><p>也谢谢ACES众能给我这个机会认真画画～</p>',119),(77,'40adcfe7-9960-11e6-8ff8-f23c91f189d6','Liby','ACES Logo Animation','Crystal Aces',1,0,2,'https://vimeo.com/188565204','2016-09-09 00:00:00','Cinema 4D, After Effects','ACES, Logo','本来是觉得キャラデサインぐ的时候头饰的水晶太难画了，于是就跑到C4D里去渲染了一个。于是顺便做了这个logo动画。caustic的效果真是好看～',59),(78,'5439a4b8-9961-11e6-8ff8-f23c91f189d6','Liby','Jellyfish','Pink Jellyfish',1,0,1,'','2016-10-22 00:00:00','Cinema 4D','Objects','好像是很久以前没填完的一个坑。这次强行把它渲染出来了。分辨率不是特别高，因为这些透明材质实在有点吃渲染时间。',65),(79,'ab8c1242-9963-11e6-8ff8-f23c91f189d6','Liby','Chemical Lab','昏暗的实验室',1,9,1,'','2016-07-01 00:00:00','iPad - Procreate','厚涂, 室内','<p>认真画了一次室内。灵感来源是某画师的Tom Clancy\'s Division的同人画，但是这次魔改了很多。本来想画成昏暗的实验室的，可是实验器材一个都画不好（噗</p><p>等我以后把这个坑填上</p>',10),(80,'1c80d265-9964-11e6-8ff8-f23c91f189d6','Liby','Random Illustration 3','黑衣少女',1,9,1,'','2016-06-24 00:00:00','iPad - Procreate','Anime','日常习作。这应该不算厚涂（？',11),(81,'5bbb697a-9965-11e6-8ff8-f23c91f189d6','Liby','Random Illustration','白衣少女',1,9,1,'','2016-06-30 00:00:00','iPad - Procreate','Anime','<span style=\"color: rgb(0, 0, 0);\">日常习作。感觉比上次那个画得更有细节一点。</span>\n                        <!-- Description Summernote comes here -->\n                    ',14),(83,'13b0e2c4-9967-11e6-8ff8-f23c91f189d6','Liby','Chromatic Aberration','Ring',1,0,2,'https://vimeo.com/188565071','2016-10-13 00:00:00','Cinema 4D','Objects, GSG','学习GSG上的例子做的。挺有趣的这个东西',68),(84,'06a2a7f7-9968-11e6-8ff8-f23c91f189d6','Liby','衣柜','Wardrobe',1,9,1,'','2016-07-18 00:00:00','iPad - Procreate','Indoors','<p>这就是我在伯克利的小房间的衣柜：）</p><p>最近学计算机学的有点抑郁，躺在床上以五月病的姿势画了这幅图。</p>',29),(85,'74b1eda9-9968-11e6-8ff8-f23c91f189d6','Liby','Piano','Just a Piano',1,9,1,'','2016-07-20 00:00:00','iPad - Procreate','Piano','<p>好想弹琴（躺</p><p>继续抑郁</p>',32),(86,'1fac9ce0-9969-11e6-8ff8-f23c91f189d6','Liby','Sunset','夕日',1,9,1,'','2016-07-12 00:00:00','iPad - Procreate','Landscape','真的是乱画。闷在房间里面渴望外面的世界。不想学计算机。',14),(87,'787f50b9-9969-11e6-8ff8-f23c91f189d6','Liby','Landscape 2','夕日',1,9,1,'','2016-07-14 00:00:00','iPad - Procreate','Landscape','学着Wlop大大的方法画了一幅。但是还是乱画的。讨厌计算机讨厌计算机',28),(88,'28a4fb5c-996b-11e6-8ff8-f23c91f189d6','Liby','算是日常习作','不知道该说什么（？',1,9,1,'','2016-04-28 00:00:00','iPad - Procreate','','额。。就这样吧。。<!-- Description Summernote comes here -->',9),(89,'7dfa0dad-996b-11e6-8ff8-f23c91f189d6','Liby','桜初音','Sakura Hatsune',1,9,1,'','2016-04-02 00:00:00','iPad - Procreate','Anime','<p>买来新iPad的第一幅画～～</p><p>姑且算是比较认真地画了</p>',6),(90,'3e76e98d-996c-11e6-8ff8-f23c91f189d6','Liby','メリイ','灰と幻想のグリムガル',1,9,1,'','2016-05-07 00:00:00','iPad - Procreate','Anime, 灰と幻想のグリムガル','<p>在琴房里补完了番。（琴房真是舒服）。然后回家就把这个画了。算是厚涂（？。不过还是不够精致啊。</p>',13),(91,'2e70fe3c-996d-11e6-8ff8-f23c91f189d6','Liby','Glass Lab (n)','ガラス',1,0,1,'','2016-10-15 00:00:00','Cinema 4D','Glass','本来看到个很好看的想仿制，结果并不是很成功。但是应该算能看吧......',52),(92,'dfe8c2a6-996d-11e6-8ff8-f23c91f189d6','Liby','日常习作','可愛い女の子',1,9,1,'','2016-10-16 00:00:00','iPad - Procreate','Anime','日常练习。上色各种苦手',75),(93,'5716a180-996e-11e6-8ff8-f23c91f189d6','Liby','日常习作++','可愛い女の子',1,9,1,'','2016-10-17 15:14:00','iPad - Procreate, Clip Studio Paint','Anime','日常习作。好像还挺可爱的。嗯真的挺可爱的。⁄(⁄ ⁄ ⁄ω⁄ ⁄ ⁄)⁄',55),(95,'66257b6d-996f-11e6-8ff8-f23c91f189d6','Liby','Game Of Life','Mess of Game Of Life',1,1,2,'https://vimeo.com/188573989','2016-10-23 00:00:00','HTML/Javascript, Quicktime, After Effects','Game of life','<p>自从把Game Of Life的网页做出来已经过了这么久了，也录过好多次屏，所以这次索性就把一堆东西全堆在一起做个效果吧。</p><p>不过最后好像感觉并不太好。算了。</p>',90),(96,'b6deaa27-9972-11e6-8ff8-f23c91f189d6','Liby','あれ？','学渣模式ON',1,9,1,'','2016-02-20 00:00:00','Clip Studio Paint','Anime, 艦これ','hhhhhh今天看到这个又被萌到啦！！话说同时也想画出来那个一脸懵逼的表情，但是不论怎么样都画不传神！并不知道为啥。啊啊啊啊小学生真是太棒啦！！！！！\n                        <!-- Description Summernote comes here -->\n                    ',8),(97,'fcee80f7-9972-11e6-8ff8-f23c91f189d6','Liby','圣诞节的公主殿下！！！','サンタ初音さん',1,9,1,'','2016-02-17 00:00:00','Clip Studio Paint','Anime, Vocaloid, 初音ミク','在做完这个网站的作品页后我深刻地发觉到自己做的作品到底有多么的少。于是今天就开工啦！！！公主殿下真的好可爱！！！但是我并不会画衣服，所以现在就先留白在那里！这次使用了Clip Studio Paint来作画，使用习惯了之后感觉真的超级好！！！！以后每天我也一定要加油！！！！<br>公主殿下我爱你啊！！！！\n                        <!-- Description Summernote comes here -->\n                    ',9),(98,'41448493-9973-11e6-8ff8-f23c91f189d6','Liby','お子様言うな！','暁ちゃん',1,9,1,'','2016-02-18 15:50:00','Clip Studio Paint','Anime, 艦これ','最近微信上经常使用“教人家装逼嘛！”这样一个表情。觉得晓实在太可爱了，于是就把她临下来上了色。跑到萌娘百科上面查，看到了她还有这样一句台词（//////////）好萌啊啊啊啊啊啊啊小学生真是太棒啦！\n                        <!-- Description Summernote comes here -->\n                    ',11),(99,'8eae7e09-9973-11e6-8ff8-f23c91f189d6','Liby','花','はな',1,9,1,'','2016-03-29 00:00:00','Clip Studio Paint','Objects','啊这次想画点不一样的东西于是就画了这个。虽然近看完全不行但是姑且远看还是说得过去的。哎哎哎我完全找不到理想画风的手感啊。\n                        <!-- Description Summernote comes here -->\n                    ',6),(100,'bf959911-9973-11e6-8ff8-f23c91f189d6','Liby','⁄(⁄ ⁄ ⁄ω⁄ ⁄ ⁄)⁄','公主殿下',1,9,1,'','2016-01-28 00:00:00','Photoshop','Anime, Vocaloid, 初音ミク','第一次把自己的绘画作品放到网上！肯定还有很多不足吧。但是我希望把自己从学习绘制插画开始的所有经历都记录下来，希望自己能一直有进步！这次的话真的狠下心来认真上了色。虽然乍一看还不错，但实际上简直跟自己希望能画出的东西简直就不是一个档次的东西。。<br>P.S.啊啊啊啊傲娇的公主殿下好萌好萌！！\n                        <!-- Description Summernote comes here -->\n                    ',14),(101,'06daa50a-9974-11e6-8ff8-f23c91f189d6','Liby','響ちゃん','可愛いいいいいいいいいい',1,9,1,'','2016-03-02 00:00:00','Clip Studio Paint','Anime, 艦これ','这次画了响酱，虽然细节什么的完全不能看不过整体感觉还是挺不错了。我还要继续加油＊小萝莉真是太棒啦\n                        <!-- Description Summernote comes here -->\n                    ',9),(102,'64d0e657-9974-11e6-8ff8-f23c91f189d6','Liby','ナナちゃん','なんかエロい......',1,9,1,'','2016-03-27 00:00:00','Clip Studio Paint','Anime, To Love る','虽然我更喜欢梦梦但是这只娜娜也好萌好萌～～～\n                        <!-- Description Summernote comes here -->\n                    ',10),(103,'ab3c58a9-9974-11e6-8ff8-f23c91f189d6','Liby','千棘ちゃん','ニセコイ',1,9,1,'','2016-03-28 00:00:00','Clip Studio Paint','Anime, ニセコイ','可爱的千棘酱。记得漫画中有一段乐终于意识到千棘酱超级可爱了。啊啊啊啊啊啊心都要化了\n                        <!-- Description Summernote comes here -->\n                    ',9),(104,'b0e2ac92-a068-11e6-8ff8-f23c91f189d6','Liby','雪女','沉迷于阴阳师无法自拔',1,5,1,'','2016-11-01 12:18:00','Blender','Anime, Character Modeling, 阴阳师','<p>竟然发布网站这么久就没有更新过作品。这可不行。不能再继续怠惰下去。</p><p>这次是特别想试一下人物建模，于是就开始无止境的实验。每次都做到一半觉得实在太烂了然后做不下去。这实在是一个十分难受的活。昨天晚上做这雪女，实在忍不下去一直看着这种白模，于是跑去生成了UV Layout在PS里面开始画。画完了觉得看起来很不错，回到Blender里把贴图放上去，然后......</p><p>瞬间关Blender有木有。</p><p>然后就跑去睡觉了。今天早上起来刷阴阳师，又看到我家雪女，......，好吧，起来把衣服做了。于是就变成了现在这个样子。</p><p>顺带一提，我还是姑且画了人物设计的：</p><p><img src=\"data:image/png;base64,\" data-filename=\"86+.png\" style=\"width: 500px;\"></p><p>虽然十分简陋，但嘛不就是这样的吗。还有裸体的版本不过鉴于......就不放上来了。嗯今天就这样，下次把整个人物的贴图都搞好再过来。</p>',72),(105,'00ec75cd-a4a3-11e6-8ff8-f23c91f189d6','Liby','Rocks and Shore','Monochromatic Painting',1,9,1,'','2016-11-06 20:00:00','Photoshop','Environmental, Shore, Rock','今天又仔细研究了wlop的厚涂，又研究了Learn Squared上的作品......好想剁手买Learn Squared上的教程啊......这幅图是看了之后想模仿一下石头的材质画的......感觉又回到wlop的套路了......乍一看自己的细节还是画的好烂啊......到底应该画成什么样啊.......果然精致的图就是不能图快来画吗？这幅图大概画了一个小时（。我滚去做经济作业了。',58),(106,'2af7cf13-a53e-11e6-8ff8-f23c91f189d6','Liby','日常习作++','可爱的小萝莉（？',1,9,1,'','2016-11-07 15:00:00','Photoshop','Anime, 厚涂','<p>日常习作。</p><p>现在又回到了Photoshop作画。其实还挺好用的，主要是看到wlop和maciara都直接用Photoshop的（</p><p>（惊奇地在Maciara的桌面上看到了Clip Studio Paint</p><p>这次完全是厚涂（。感觉好像比之前的上色要成熟一点点。</p><p>以后还是主要搞厚涂吧。剁了Learn Squared的Environment Painting，觉得还挺好的，之后多去模仿一下别人的作品嗯。</p>',50),(107,'20c50048-abd2-11e6-8ff8-f23c91f189d6','Liby','Street Light','路灯',1,0,1,'','2016-11-15 00:00:00','Blender, Cinema 4D','Environmental','突然想起做一个欧风的路灯，于是用了Blender建模。话说回来在用C4D做渲染的时候手都生疏得不知道该怎么操作了，果然还是Blender的建模系统更顺手一点啊',109),(108,'68e0b688-ad49-11e6-8ff8-f23c91f189d6','Liby','Environmental Sketch #1','悬崖边上的堡垒',1,9,1,'','2016-11-17 16:00:00','Photoshop','Environmental, Sketch, Bazantine','<p>认真开始学Environmental Painting，先sketch一些小东西。</p><p>这个的风格是拜占庭的Fortress，放在悬崖上只是一时兴起。</p><p>姑且还算是画出来点东西了。之后要多多多多多多多练习嗯。</p>',95),(109,'226a42c0-ad4a-11e6-8ff8-f23c91f189d6','Liby','Environmental Sketch #2','Medieval Castle',1,9,1,'','2016-11-17 21:00:00','Photoshop','Environmental, Sketch, Medieval','照着随便找的一张Medieval Castle的照片临摹，风格是Cross Hatching，依旧是普通的练习。虽然仔细一看的话各种重点都没怎么突出出来，果然还是要多修炼一下明暗关系。',53),(110,'66506473-e6b0-11e6-8eaa-f23c91f189d6','Liby','FORMS | 献给你一座B栋','不永恒的B栋，承载着永恒',1,5,1,'','2017-01-01 21:51:00','MineCraft, Photoshop, Cinema4D, Blender, Illustrator','SZMS, 3D Printing','<p>B栋</p><p>也算是花了超级多的时间，总算在元旦的时候让这个计划没有烂尾。</p><p>谢谢校友们老师们还有校长的支持，今天我们都非常开心。</p><p>钥匙妹和B栋都基本上卖完了，我们的劳动也算是有所回报。</p><p>至于盈利啊、、其实我们好像真的没怎么赚钱、、赚到最多钱的果然还是明信片吧、、</p><p>啊还有啊，在台前玩MineCraft的小萝莉真的好可爱啊</p><p><!-- Description Summernote comes here --></p>',9);
